import { useContext } from "react";
import TaskContext from "../../store/task-list";
import styleContainer from './TaskList.module.css'
import TaskCircleProgress from "./TaskCircleProgress";
import SvgIconTaskList from "./SvgIconTaskList";

const TaskList = () => {
  const ctx = useContext(TaskContext);
  let variable = ctx.map((ctx) => (
    <div key={Math.random()} className={styleContainer.taskCard}>
        {ctx}
      <div className={styleContainer.taskName}>
        <span className={styleContainer.taskTitle}>Task</span>
        <span className={styleContainer.task}></span>
      </div>
      <div className={styleContainer.taskPriority}>
        <span className={styleContainer.priorityTitle}>Priority</span>
        <span className={styleContainer.priority}></span>
      </div>
      <div className={styleContainer.taskStatus}>
        <button className={styleContainer.status}></button>
      </div>
      <div className={styleContainer.taskProgress}>
        <TaskCircleProgress/>
      </div>
      <div className={styleContainer.taskActions}>
        <SvgIconTaskList />
      </div>
    </div>
  ));
  return (
    <div className={styleContainer.container}>
      {variable}
    </div>
  );
};

export default TaskList;
